import React, {useRef,useEffect}from 'react'
import Header from '../../Fixed-Components/Header/Header';
import Footer from '../../Fixed-Components/Footer/Footer';
import './home.css';
import logo from './logo.jpg' ;
import { TweenMax, Power3 } from "gsap";

function HomeUI() {
        let divOne = useRef(null);
        let divOneLogo = useRef(null);
        let divOneParagraph = useRef(null);
        
        useEffect(()=> {
        TweenMax.to(
            divOneLogo,
            .8,
            {
    
                ease: Power3.easeInOut,
                delay: 0.9
            }
        )
        },[])

        return (
            <>
          <Header></Header>
          <div className="home">
            <div  ref={el => (divOne = el)} className="first-div">
                <div  ref={el => (divOneParagraph = el)}className="brief">
                    <h1> مهمتنا هي تعزيز كفاءة التعليم والتدريب والدور القيادي للشباب عن طريق 
             دعم جيل جديد
                      من الشباب ليصحبوا قادة متعلمين، مهنيين مهرة، ورواداَ يلهمون أفراد عائلتهم للتكاثف وتحقيق الازدهار</h1>

                    <button>  المزيد عنا</button>

                </div>
                <div  ref={el => (divOneLogo = el)} className="logo-div-one">
                <img src={logo}></img>
                </div>
            </div>
            <div className="second-div">
             
              
            </div>
            <div className="third-div">
              
            </div>
            <div className="fourth-div">
                
            </div>
            <div className="fifth-div">
               
            </div>
            <div className="sixth-div">
             
            </div>

          </div>
          <Footer />
          </>
        )
    }
export default HomeUI;
